import React from "react";
import "./navbar.css";
import { Link } from "react-router-dom";
const Navbar = () => {
  return (
    <div className="container">
      <div className="Nav">
        <Link to="/">
          <h1>Home</h1>
        </Link>
        <div className="RightNav">
          <Link to="/Contact">
            <h1>Contact Us</h1>
          </Link>
          <Link to="/About">
            <h1>About Us</h1>
          </Link>
          <Link to="/Login">
            <button className="btnSignIn" type="button">
              Click Me!
            </button>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
